import { Fragment } from "react";

import mealsPic from "../../assets/mealspic.jpg";

const Header = (props) => {
  return (
    <Fragment>
      <header>
        <h1>ReactMeals</h1>
      </header>
      <div>
        <img src={mealsPic} />
      </div>
    </Fragment>
  );
};

export default Header;
